electron-builder是用于打包Electron应用程序的开源工具，它可以将应用程序打包成各种各样的安装程序和归档文件。如果您想在打包过程中将固定文件导入应用程序，可以使用electron-builder中的`extraResources`属性来指定要复制到应用程序包中的文件或目录。

例如，如果您想将一个名为`config.json`的文件复制到您的应用程序包中，您可以将以下内容添加到您的`package.json`文件中：

```json
{
  "build": {
    "extraResources": [
      {
        "from": "config.json",
        "to": "."
      }
    ]
  }
}
```

上述代码将`config.json`文件复制到应用程序包的根目录中。您可以根据需要将`from`和`to`属性修改为相应的路径。
